import React, { useState } from 'react';
import './ProductDetails.css'; // Ensure you have a corresponding CSS file for styling

const ProductDetails = () => {
  const [pickupOption, setPickupOption] = useState('In-Store Pickup');
  const [pickupDate, setPickupDate] = useState('');
  const [pickupTime, setPickupTime] = useState('');

  const handlePickupOptionChange = (event) => {
    setPickupOption(event.target.value);
  };

  const handleDateChange = (event) => {
    setPickupDate(event.target.value);
  };

  const handleTimeChange = (event) => {
    setPickupTime(event.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission logic here
    console.log('Reservation Submitted:', {
      pickupOption,
      pickupDate,
      pickupTime,
    });
  };

  return (
    <div className="product-details-container">
      <h1>Store Selection</h1>

      <div className="product-image">
        <img src="path-to-smartphone-image.jpg" alt="Smartphone" />
      </div>

      <form onSubmit={handleSubmit}>
        <div className="reservation-details">
          <h2>Reservation Details</h2>
          <div className="store-info">
            <h3>Downtown Store</h3>
            <p>123 Main Street, Anytown, USA</p>
            <p>Phone: (123) 456-7890</p>
          </div>
        </div>

        <div className="contact-information">
          <h2>Contact Information</h2>
          <div className="form-group">
            <label>Full Name</label>
            <input type="text" placeholder="Enter your name" required />
          </div>
          <div className="form-group">
            <label>Email Address</label>
            <input type="email" placeholder="Enter your email" required />
          </div>
          <div className="form-group">
            <label>Phone Number</label>
            <input type="tel" placeholder="Enter your phone number" required />
          </div>
        </div>

        <div className="pickup-options">
          <h2>Pickup Options</h2>
          <div className="radio-group">
            <label>
              <input
                type="radio"
                name="pickupOption"
                value="In-Store Pickup"
                checked={pickupOption === 'In-Store Pickup'}
                onChange={handlePickupOptionChange}
              />
              In-Store Pickup
            </label>
            <label>
              <input
                type="radio"
                name="pickupOption"
                value="Curbside Pickup"
                checked={pickupOption === 'Curbside Pickup'}
                onChange={handlePickupOptionChange}
              />
              Curbside Pickup
            </label>
          </div>
        </div>

        <div className="pickup-time">
          <h2>Pickup Time</h2>
          <div className="form-group">
            <label>Preferred Date</label>
            <input
              type="date"
              value={pickupDate}
              onChange={handleDateChange}
              required
            />
          </div>
          <div className="form-group">
            <label>Preferred Time</label>
            <input
              type="time"
              value={pickupTime}
              onChange={handleTimeChange}
              required
            />
          </div>
        </div>

        <div className="reservation-summary">
          <h2>Reservation Summary</h2>
          <p><strong>Product:</strong> Smartphone XYZ</p>
          <p><strong>Pickup Option:</strong> {pickupOption}</p>
          <p><strong>Pickup Date:</strong> {pickupDate}</p>
          <p><strong>Pickup Time:</strong> {pickupTime}</p>
        </div>

        <button type="submit" className="submit-btn">Reserve Now</button>
      </form>
    </div>
  );
};

export default ProductDetails;
